import { saveAs } from 'file-saver';
import { pdf } from '@react-pdf/renderer';

const downloadFile = async (documentData, fileName) => {
  const blob = await pdf(documentData).toBlob();
  saveAs(blob, fileName);
};

export default downloadFile;
